import logo from "./chessQueen.png";
import React, { useState, useEffect } from 'react';
import "./App.css";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import Accordion from "react-bootstrap/Accordion";

function App() {
	const [players, setPlayers] = useState([]);

	useEffect(() => {
        fetch('https://localhost:7059/Player/players')
            .then(response => response.json())
            .then(data => setPlayers(data))
            .catch(error => console.error('Error fetching data:', error));
    }, []); // Empty dependency array means this effect runs once on mount


	return (
		<div className="App">
			<header className="App-header">
				<img src={logo} className="App-logo" alt="logo" />
				<div>
					<h1>
						To play, use <a href="https://lichess.org">Lichess</a>!
					</h1>
					<h1>Winning a game: 3 points</h1>
					<h1>Losing a game: 0 points</h1>
					<h1>Draw: 1 points each</h1>
				</div>
				<hr class="separator" />
				<div class="accordions">
					<Accordion>
					{players.map((player, index) => (
                        <Accordion.Item eventKey={index.toString()} key={player.id}>
                            <Accordion.Header>{player.name} - {player.elo} points</Accordion.Header>
                            <Accordion.Body>
                                {/* Additional details about the player can go here */}
                            </Accordion.Body>
                        </Accordion.Item>
                    ))}

					</Accordion>
				</div>
				<a
					className="App-link"
					href="https://reactjs.org"
					target="_blank"
					rel="noopener noreferrer"
				>
					Learn React
				</a>
			</header>
		</div>
	);
}

function NavbarMenu() {
	return (
		<Navbar expand="lg" className="bg-body-tertiary">
			<Container>
				<Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
				<Navbar.Toggle aria-controls="basic-navbar-nav" />
				<Navbar.Collapse id="basic-navbar-nav">
					<Nav className="me-auto">
						<Nav.Link href="#home">Home</Nav.Link>
						<Nav.Link href="#link">Link</Nav.Link>
						<NavDropdown title="Dropdown" id="basic-nav-dropdown">
							<NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
							<NavDropdown.Item href="#action/3.2">
								Another action
							</NavDropdown.Item>
							<NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
							<NavDropdown.Divider />
							<NavDropdown.Item href="#action/3.4">
								Separated link
							</NavDropdown.Item>
						</NavDropdown>
					</Nav>
				</Navbar.Collapse>
			</Container>
		</Navbar>
	);
}

class Player {
	constructor(name, elo) {
		this.name = name;
		this.elo = elo;
	}
}

export { App, NavbarMenu };
